import stylesMenuItems from "./stylesMenuItems.module.css";
function MenuItems() {
  return (
    <ul className={stylesMenuItems.list}>
      <li>Булки</li>
      <li>Соусы</li>
      <li>Начинки</li>
    </ul>
  );
}

export default MenuItems;
